            name: 'data',
            label: '数据管理',
            icon: 's-data',
            url: 'Data/Data'
            },
            {
            path: '/count',
            name: 'count',
            label: '数据计算',
            icon: 'video-play',
            url: 'Count/Count'
            },
            {
            path: '/user',
            name: 'user',
            label: '用户管理',
            icon: 'user',
            url: 'UserManage/UserManage'
            },
            {
            label: '体系管理',
            icon: 's-grid',
            children: [
                {
                path: '/indicator',
                name: 'indicator',
                label: '指标管理',
                icon: 'setting',
                url: 'Other/PageOne'
                },
                {
                path: '/operator',
                name: 'operator',
                label: '算子管理',
                icon: 'setting',
                url: 'Other/PageTwo'
                }
            ]
            }
        ]
    },
    mutations:{
        collapseMenu(state){
            state.isCollapse=!state.isCollapse
        },
        selectMenu(state,val){
            console.log(val,'val')
            if(val.name!=='indicator'){
                const index =state.tabsList.findIndex(item=>item.name === val.name)
                if(index===-1){
                    state.tabsList.push(val)
                }
            }
        }
    }
}
